B.Mf=new A.cG("Mobile Articulated Navigator(MARTIN) is my undergraduate final year research project that combines the skills of robotics, sensor integration, and software development. The robot was developed to detect, pick an object, and autonomously transport the object to a given goal destination. RPLiDAR sensor was used for creating map of the environment and for obstacle avoidance. It also involved state and position estimation of the robot through sensor fusion of wheel encoders and IMU, ensuring the autonomous locomotion of the robot with implementation of SLAM algorithms and ROS Navigation Stack. A depth camera was employed for 3D object detection through YOLOv5 algorithm and the Robotic arm mounted on the mobile base was configured for pick and place operations by using MoveIt.",null,B.dl,null,null)
B.Mg=new A.cG("In the Robocon 2021 competition, our team developed two robots: an Arrow Launching Robot and an Arrow Picking Robot. The Arrow Launching Robot featured an impressive design with three launchers. This allowed the robot to simultaneously launch multiple arrows towards specific targets with precision and speed. Each launcher was meticulously calibrated to ensure accurate trajectory and target hitting. On the other hand, the Arrow Picking Robot showcased a robotic arm for efficient arrow retrieval. Equipped with an omni wheel drive system, the robot swiftly navigated the competition area, collecting scattered arrows with the assistance of its robotic arm. Both robots demonstrated our team's technical expertise and innovative approaches, enhancing our performance in the RoboCon 2021 competition and by securing the 15th position in the All India rankings.",null,B.dl,null,null)
